import React from "react";
import styled from "styled-components";

const Register = () => {
  const handleSubmit = (e) => {
  e.pre
}

  return (
    <Container>
      <Form onSubmit={() => handleSubmit}></Form>
    </Container>
  );
};

const Container = styled.div``;

const Form = styled.form``;

export default Register;
